INSERT INTO `inventory_search` (`type`, `subtype`, `match`, `list`, `query`, `ruleorder`) VALUES
('Alarms', 'IP is Src', 'boolean', '', 'SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm', 999),
('META', 'Has Dst IP', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm', 999),
('META', 'Date After', 'date', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc WHERE day > ? UNION SELECT INET_NTOA(src_ip) as ip FROM alarm UNION SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE timestamp > ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst WHERE day > ? UNION SELECT INET_NTOA(dst_ip) as ip FROM alarm WHERE timestamp > ? UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE timestamp > ?', 999),
('META', 'Port as Src or Dst', 'concat', 'SELECT CONCAT(p1.port_number,"-",p2.id) as port_value,CONCAT(p1.port_number,"-",p1.protocol_name) as port_text FROM port p1, protocol p2 WHERE p1.protocol_name=p2.name', 'SELECT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_sport_ipsrc WHERE layer4_sport=? AND ip_proto=? UNION SELECT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_sport_ipdst WHERE layer4_sport=? AND ip_proto=? UNION SELECT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_dport_ipsrc WHERE layer4_dport=? AND ip_proto=? UNION SELECT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_dport_ipdst WHERE layer4_dport=? AND ip_proto=?', 999),
('META', 'IP as Src', 'ip', 'SELECT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_dst) AS ip FROM snort.ac_dstaddr_ipsrc WHERE INET_NTOA(ip_src) %op% ? UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE INET_NTOA(src_ip) %op% ?', 999),
('META', 'IP as Dst', 'ip', 'SELECT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_src) AS ip FROM snort.ac_srcaddr_ipdst WHERE INET_NTOA(ip_dst) %op% ? UNION SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE INET_NTOA(dst_ip) %op% ?', 999),
('META', 'IP as Src or Dst', 'ip', 'SELECT DISTINCT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_dst) AS ip FROM snort.ac_dstaddr_ipsrc WHERE INET_NTOA(ip_src) %op% ? UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE INET_NTOA(src_ip) %op% ? UNION SELECT DISTINCT INET_NTOA(ip_src) AS ip FROM snort.ac_srcaddr_ipdst WHERE INET_NTOA(ip_dst) %op% ? UNION SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE INET_NTOA(dst_ip) %op% ?', 999),
('META', 'Source Port', 'concat', 'SELECT CONCAT(p1.port_number,"-",p2.id) as port_value,CONCAT(p1.port_number,"-",p1.protocol_name) as port_text FROM port p1, protocol p2 WHERE p1.protocol_name=p2.name', 'SELECT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_sport_ipsrc WHERE layer4_sport=? AND ip_proto=? UNION SELECT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_sport_ipdst WHERE layer4_sport=? AND ip_proto=?', 999),
('META', 'Destination Port', 'concat', 'SELECT CONCAT(p1.port_number,"-",p2.id) as port_value,CONCAT(p1.port_number,"-",p1.protocol_name) as port_text FROM port p1, protocol p2 WHERE p1.protocol_name=p2.name', 'SELECT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_dport_ipsrc WHERE layer4_dport=? AND ip_proto=? UNION SELECT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_dport_ipdst WHERE layer4_dport=? AND ip_proto=?', 999),
('SIEM Events', 'Has Different', 'number', '', 'select inet_ntoa(t1.ip) as ip from (select count(distinct plugin_id, plugin_sid) as total,ip from (select plugin_id, plugin_sid, ip_src as ip from snort.ac_alerts_ipsrc union select plugin_id, plugin_sid ,ip_dst as ip from snort.ac_alerts_ipdst) as t group by ip) as t1 where t1.total >= ?', 5),
('SIEM Events', 'Has Event', 'boolean', NULL, 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst', 5),
('SIEM Events', 'Has no Event', 'boolean', NULL, 'SELECT ip FROM host WHERE ip NOT IN (SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst)', 5),
('SIEM Events', 'Has Events', 'text', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_srcaddr_signature s, ossim.plugin_sid p WHERE s.plugin_id=p.plugin_id AND s.plugin_sid=p.sid AND p.name %op% ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_dstaddr_signature s, ossim.plugin_sid p WHERE s.plugin_id=p.plugin_id AND s.plugin_sid=p.sid AND p.name %op% ?', 5),
('SIEM Events', 'Has Plugin Groups', 'fixed', 'SELECT group_id,name FROM plugin_group_descr', 'SELECT INET_NTOA(ip_src) as ip FROM snort.acid_event WHERE plugin_id in (SELECT plugin_id FROM ossim.plugin_group WHERE group_id=?) UNION SELECT INET_NTOA(ip_dst) as ip FROM snort.acid_event WHERE plugin_id in (SELECT plugin_id FROM ossim.plugin_group WHERE group_id=?)', 5),
('SIEM Events', 'Has IP', 'ip', 'SELECT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_srcaddr_ipdst WHERE INET_NTOA(ip_src) %op% ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_dstaddr_ipsrc WHERE INET_NTOA(ip_dst) %op% ?', 5),
('SIEM Events', 'Has Src IP', 'ip', 'SELECT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_dst) AS ip FROM snort.ac_dstaddr_ipsrc WHERE INET_NTOA(ip_src) %op% ?', 5),
('SIEM Events', 'Has Dst IP', 'ip', 'SELECT ip FROM host', 'SELECT DISTINCT INET_NTOA(ip_src) AS ip FROM snort.ac_srcaddr_ipdst WHERE INET_NTOA(ip_dst) %op% ?', 5),
('SIEM Events', 'Has Port', 'concat', 'SELECT DISTINCT CONCAT(p.id,"-",h.port) as protocol_value,CONCAT(h.port,"-",p.name) as protocol_text from host_services h,protocol p where h.protocol=p.id order by h.port', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_sport_ipdst WHERE ip_proto = ? AND layer4_sport = ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_sport_ipsrc WHERE ip_proto = ? AND layer4_sport = ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_dport_ipdst WHERE ip_proto = ? AND layer4_dport = ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_dport_ipsrc WHERE ip_proto = ? AND layer4_dport = ?', 5),
('SIEM Events', 'Has Src Port', 'concat', 'SELECT DISTINCT CONCAT(p.id,"-",h.port) as protocol_value,CONCAT(h.port,"-",p.name) as protocol_text from host_services h,protocol p where h.protocol=p.id order by h.port', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_sport_ipdst WHERE ip_proto = ? AND layer4_sport = ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_sport_ipsrc WHERE ip_proto = ? AND layer4_sport = ?', 5),
('SIEM Events', 'Has Dst Port', 'concat', 'SELECT DISTINCT CONCAT(p.id,"-",h.port) as protocol_value,CONCAT(h.port,"-",p.name) as protocol_text from host_services h,protocol p where h.protocol=p.id order by h.port', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_layer4_dport_ipdst WHERE ip_proto = ? AND layer4_dport = ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_layer4_dport_ipsrc WHERE ip_proto = ? AND layer4_dport = ?', 5),
('SIEM Events', 'Has Protocol', 'fixed', 'SELECT id,alias FROM protocol', 'SELECT DISTINCT INET_NTOA(snort.acid_event.ip_src) as ip FROM snort.acid_event WHERE snort.acid_event.ip_proto=? LIMIT 999', 5),
('Alarms', 'Has Alarm', 'boolean', '', 'SELECT INET_NTOA(src_ip) as ip FROM alarm UNION SELECT INET_NTOA(dst_ip) as ip FROM alarm', 999),
('Alarms', 'Has no Alarm', 'boolean', '', '(select distinct inet_ntoa(ip) as ip from (select inet_aton(ip) as ip from host UNION select distinct ip_src as ip from snort.ac_srcaddr_ipsrc) as todas WHERE ip not in (select distinct src_ip from alarm)) UNION (select DISTINCT inet_ntoa(ip) as ip from (select inet_aton(ip) as ip  from host UNION select ip_src as ip from snort.ac_srcaddr_ipsrc) as todas WHERE ip not in (select distinct dst_ip from alarm))', 999),
('Tickets', 'Has Tickets', 'boolean', '', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id', 999),
('Tickets', 'Has no Ticket', 'boolean', '', 'select distinct inet_ntoa(ip) as ip from (select inet_aton(ip) as ip from host UNION select distinct ip_src as ip from snort.ac_srcaddr_ipsrc) as todas WHERE ip NOT IN (SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id)', 999),
('Tickets', 'Has Ticket Type', 'fixed', 'SELECT id as type_value,id as type_text FROM incident_type', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id AND i.type_id=?', 999),
('Tickets', 'Has Ticket Tag', 'fixed', 'SELECT id as tag_id,name as tag_name FROM incident_tag_descr', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a,incident_tag t WHERE i.id=a.incident_id AND i.id=t.incident_id AND t.tag_id=?', 999),
('Mac', 'Has Mac', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip) as ip FROM host_mac', 3),
('Mac', 'Has No Mac', 'boolean', '', 'SELECT ip FROM host WHERE ip NOT IN (SELECT DISTINCT INET_NTOA(ip) as ip FROM host_mac)', 3),
('Mac', 'Has Anomaly', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_mac.ip) as ip FROM (SELECT DISTINCT ip as lastip,max(date) as maxdate FROM host_mac GROUP BY ip) maxdates,host_mac WHERE host_mac.ip=maxdates.lastip AND host_mac.date=maxdates.maxdate AND host_mac.anom=1', 3),
('Mac', 'Has no Anomaly', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_mac.ip) as ip FROM (SELECT DISTINCT ip as lastip,max(date) as maxdate FROM host_mac GROUP BY ip) maxdates,host_mac WHERE host_mac.ip=maxdates.lastip AND host_mac.date=maxdates.maxdate AND host_mac.anom=0', 3),
('SIEM Events', 'IP is Dst', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst LIMIT 999', 5),
('META', 'Has Src or Dst IP', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc UNION SELECT INET_NTOA(src_ip) as ip FROM alarm UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst UNION SELECT INET_NTOA(dst_ip) as ip FROM alarm', 999),
('Alarms', 'IP is Dst', 'boolean', '', 'SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm', 999),
('META', 'Has Src IP', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc UNION SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm', 999),
('META', 'Date Before', 'date', NULL, 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc WHERE day < ? UNION SELECT INET_NTOA(src_ip) as ip FROM alarm UNION SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE timestamp < ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.ac_alerts_ipdst WHERE day < ? UNION SELECT INET_NTOA(dst_ip) as ip FROM alarm WHERE timestamp < ? UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE timestamp < ?', 999),
('SIEM Events', 'IP is Src', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.ac_alerts_ipsrc LIMIT 999', 5),
('Alarms', 'Has open Alarms', 'boolean', '', 'SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE status=''open'' UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE status=''open''', 999),
('Alarms', 'Has closed Alarms', 'boolean', '', 'SELECT DISTINCT INET_NTOA(src_ip) as ip FROM alarm WHERE status=''closed'' UNION SELECT DISTINCT INET_NTOA(dst_ip) as ip FROM alarm WHERE status=''closed''', 999),
('OS', 'OS is', 'text', 'SELECT DISTINCT os FROM host_os WHERE os != "" ORDER BY os', '(select distinct inet_ntoa(ip) as ip from host_properties where property_ref=3 and value like ?) UNION (select distinct inet_ntoa(h.ip) as ip from host_os h where h.os %op% ? and h.anom=0 and h.ip not in (select h1.ip from host_os h1 where h1.os<>? and h1.anom=0 and h1.date>h.date)) UNION (select distinct inet_ntoa(ip) from host_os where os %op% ? and anom=1 and ip not in (select distinct ip from host_os where anom=0))', 1),
('OS', 'OS is Not', 'text', 'SELECT DISTINCT os FROM host_os WHERE os != "" ORDER BY os', 'select distinct inet_ntoa(ip) as ip from host_os where ip not in (select distinct inet_ntoa(ip) as ip from host_properties where property_ref=3 and value like ? UNION select h.ip from host_os h where h.os %op% ? and h.anom=0 and h.ip not in (select h1.ip from host_os h1 where h1.os<>? and h1.anom=0 and h1.date>h.date)) UNION (select ip from host_os where os %op% ? and anom=1 and ip not in (select distinct ip from host_os where anom=0))', 1),
('OS', 'Has Anomaly', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_os.ip) as ip FROM (SELECT DISTINCT ip as lastip,max(date) as maxdate FROM host_os GROUP BY ip) maxdates,host_os WHERE host_os.ip=maxdates.lastip AND host_os.date=maxdates.maxdate AND host_os.anom=1', 1),
('OS', 'Has no Anomaly', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_os.ip) as ip FROM (SELECT DISTINCT ip as lastip,max(date) as maxdate FROM host_os GROUP BY ip) maxdates,host_os WHERE host_os.ip=maxdates.lastip AND host_os.date=maxdates.maxdate AND host_os.anom=0', 1),
('Services', 'Has services', 'fixed', 'SELECT DISTINCT service as service_value, service as service_text FROM host_services', 'SELECT DISTINCT INET_NTOA(ip) as ip FROM host_services WHERE service=?', 2),
('Services', 'Doesnt have service', 'fixed', 'SELECT DISTINCT service as service_value, service as service_text FROM host_services', 'SELECT DISTINCT ip FROM host WHERE ip NOT IN (SELECT DISTINCT INET_NTOA(ip) as ip FROM host_services WHERE service=?)', 2),
('Services', 'Has Anomaly', 'boolean', '', 'select distinct inet_ntoa(h.ip) as ip from host_services h,host_services h1 where h1.ip=h.ip AND h.anom=0 AND h1.anom=1 AND h.port=h1.port AND h.date<=h1.date', 2),
('Services', 'Has no Anomaly', 'boolean', '', 'SELECT DISTINCT INET_NTOA(ip) as ip FROM host_services WHERE ip NOT IN (select distinct inet_ntoa(h.ip) as ip from host_services h,host_services h1 where h1.ip=h.ip AND h.anom=0 AND h1.anom=1 AND h.port=h1.port AND h.date<=h1.date)', 2),
('SIEM Events', 'Has user', 'text', '', 'SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.acid_event,snort.extra_data WHERE snort.extra_data.sid=snort.acid_event.sid AND snort.extra_data.cid=snort.acid_event.cid AND snort.extra_data.username %op% ?', 5),
('Tickets', 'Priority is greater than', 'number', '', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id AND i.priority>?', 999),
('Tickets', 'Priority is lower than', 'number', '', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id AND i.priority<?', 999),
('Tickets', 'Is older Than Days', 'number', '', 'SELECT DISTINCT a.src_ips as ip FROM incident i,incident_alarm a WHERE i.id=a.incident_id AND DATEDIFF(CURRENT_TIMESTAMP ,i.last_update) > ?', 999),
('Vulnerabilities', 'Has Vuln', 'fixed', 'SELECT sid as plugin_value,name as plugin_text FROM plugin_sid WHERE plugin_id =3001', 'SELECT DISTINCT INET_NTOA(host_ip) as ip FROM host_plugin_sid WHERE plugin_id = 3001 AND plugin_sid = ?', 4),
('Vulnerabilities', 'Vuln Contains', 'text', '', 'SELECT DISTINCT INET_NTOA(hp.host_ip) as ip FROM host_plugin_sid hp, plugin_sid p WHERE hp.plugin_id = 3001 AND p.plugin_id = 3001 AND hp.plugin_sid = p.sid AND p.name %op% ? UNION SELECT DISTINCT INET_NTOA(s.host_ip) as ip FROM vuln_nessus_plugins p,host_plugin_sid s WHERE s.plugin_id=3001 and s.plugin_sid=p.id AND p.name %op% ?', 4),
('Vulnerabilities', 'Has Vulns', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_ip) as ip FROM host_plugin_sid WHERE plugin_id = 3001', 4),
('Vulnerabilities', 'Has no Vulns', 'boolean', '', 'SELECT DISTINCT INET_NTOA(host_ip) as ip FROM host_plugin_sid WHERE host_ip NOT IN (SELECT host_ip FROM host_plugin_sid WHERE plugin_id = 3001)', 4),
('Vulnerabilities', 'Vuln Level is greater than', 'number', '', 'SELECT DISTINCT ip FROM host_vulnerability WHERE vulnerability > ?', 4),
('Vulnerabilities', 'Vuln Level is lower than', 'number', '', 'SELECT DISTINCT ip FROM host_vulnerability WHERE vulnerability < ?', 4),
('Asset', 'Asset is greater than', 'number', '', 'SELECT DISTINCT ip FROM host WHERE asset > ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.acid_event WHERE ossim_asset_src > ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.acid_event WHERE ossim_asset_dst > ?', 999),
('Asset', 'Asset is lower than', 'number', '', 'SELECT DISTINCT ip FROM host WHERE asset < ? AND asset > 0 UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.acid_event WHERE ossim_asset_src < ? AND ossim_asset_src > 0 UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.acid_event WHERE ossim_asset_dst < ? AND ossim_asset_dst > 0', 999),
('Asset', 'Asset is', 'fixed', 'SELECT DISTINCT asset FROM host ORDER BY asset', 'SELECT DISTINCT ip FROM host WHERE asset = ? UNION SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.acid_event WHERE ossim_asset_src = ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.acid_event WHERE ossim_asset_dst = ?', 999),
('Vulnerabilities', 'Vuln risk is greater than', 'number', '', 'SELECT DISTINCT INET_NTOA(h.host_ip) as ip FROM host_plugin_sid h,vuln_nessus_plugins p WHERE h.plugin_id=3001 AND h.plugin_sid=p.id AND 8-p.risk > ?', 4),
('Vulnerabilities', 'Vuln risk is lower than', 'number', '', 'SELECT DISTINCT INET_NTOA(h.host_ip) as ip FROM host_plugin_sid h,vuln_nessus_plugins p WHERE h.plugin_id=3001 AND h.plugin_sid=p.id AND 8-p.risk < ?', 4),
('Asset', 'Asset is local', 'fixed', 'SELECT DISTINCT asset FROM host ORDER BY asset', 'SELECT DISTINCT ip FROM host WHERE asset = ?', 999),
('Asset', 'Asset is remote', 'number', '', 'SELECT ip FROM (SELECT DISTINCT INET_NTOA(ip_src) as ip FROM snort.acid_event WHERE ossim_asset_src = ? UNION SELECT DISTINCT INET_NTOA(ip_dst) as ip FROM snort.acid_event WHERE ossim_asset_dst = ?) remote WHERE ip NOT IN (SELECT DISTINCT ip FROM host)', 999),
('Vulnerabilities', 'Has Vuln Service', 'text', 'SELECT DISTINCT app FROM vuln_nessus_results', 'SELECT DISTINCT hostIP as ip FROM vuln_nessus_results WHERE app %op% ?', 999),
('Vulnerabilities', 'Has CVE', 'text', 'SELECT DISTINCT cve_id FROM vuln_nessus_plugins', 'SELECT DISTINCT INET_NTOA(s.host_ip) as ip FROM vuln_nessus_plugins p,host_plugin_sid s WHERE s.plugin_id=3001 and s.plugin_sid=p.id AND p.cve_id %op% ?', 4),
('Property', 'Has Property', 'fixed', 'SELECT DISTINCT id as property_value, name as property_text  FROM host_property_reference ORDER BY name', 'SELECT DISTINCT * FROM host_properties WHERE property_ref = ?', 999),
('Property', 'Has not Property', 'fixed', 'SELECT DISTINCT id as property_value, name as property_text  FROM host_property_reference ORDER BY name', 'SELECT DISTINCT * FROM host_properties WHERE property_ref != ?', 999),
('Property', 'Contains', 'fixedText', 'SELECT DISTINCT id as property_value, name as property_text  FROM host_property_reference ORDER BY name', 'SELECT DISTINCT * FROM host_properties WHERE property_ref = ? AND (value LIKE ''%$value2%'' OR extra LIKE ''%$value2%'')', 999);
